import React, { Component } from 'react';
import NavBar from '../src/components/functional/NavBar'
import Cities from '../src/components/containers/Cities'
import LandingPage from '../src/components/containers/LandingPage'
import { BrowserRouter, Route } from 'react-router-dom'

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <NavBar />
        <Route exact path='/' component={LandingPage} />
        <Route path='/posts' component={Cities} />
        <Route path="/:post_id" component={City} />
        <Route path='/signin' component={SignInPage} />
        <Route path='/signup' component={SignUp} />
      </BrowserRouter>
    );
  }
}

export default App;
